    contribution to Levin for Congress on 7/14/2010 for $230.00.  We inadvertently
    designated the contribution to the General 2010 election when it should have been
    designated to the Primary 2010 election because it was made prior to the Michigan
    Primary. The committee notified us within 60 days.  Reflected on this report,
    we are re-designating the $230.00 in-kind contribution to the Primary 2010 election
    and redesignating $230.00 of a $2,000 contribution made on 6/14/10 from the Primary
    2010 to the General 2010 election.  This does not affect out previous report or
    our limits.\n"
